graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "critical" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>critical</b> <i>&lt;task&gt;</i> <i>@Critical @Async</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", penwidth=3];
  "legacy" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>legacy</b> <i>&lt;resource&gt;</i> <i>@Deprecated("Use newResource instead")</i></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style="filled,dashed", color="#000000", fontcolor="#999999"];

}
